async function deleteData(userId) {
    await Session.deleteMany({});
    await Story.deleteMany({});
    await Character.deleteMany({});
    await Player.deleteMany({});
    await Coterie.deleteMany({});
    await User.deleteMany({
        _id: {
            $ne: userId
        }
    });
    await Chronicle.deleteMany({});
}

async function importData(userId) {
    let i, j;
    var user = await User.findById(userId);
    if (user) {
        let chronicle = await createChronicle(userId);

        let players = [];

        // create players
        for (i = 0; i < 6; i++) {
            players.push(await createPlayer(chronicle._id));
        }

        // create stories
        for (i = 0; i < 5; i++) {
            let story = await createStory(chronicle);
            await story.save();
            let year = "201" + (i + 4).toString();
            let sessionsLength = 10 + Math.floor(Math.random() * 20);
            for (j = 0; j < sessionsLength; j++) {
                let session = await cerateSession(story, players, parseInt(year))
                story.sessions.push(session);
            }
            await story.save();
        }

        // create coteries
        for (i = 0; i < 6; i++) {
            let coterie = await createCoterie(chronicle._id, userId);

            let coterieLength = 3 + Math.floor(Math.random() * 5);

            for (j = 0; j < coterieLength; j++) {
                let character = await createCharacter(chronicle._id);
                coterie.characters.push(character);
            }
            await coterie.save();
            chronicle.coteries.push(coterie);
        }
        await chronicle.save();
    }
}

async function cerateSession(story, players, year) {
    let session = new Session({
        sessionDate: randomDate(year),
        globalNote: lorem.generateParagraphs(1),
        characters: [],
        completed: true,
        chronicleId: story.chronicleId,
        storyId: story._id,
        storyTeller: story.storyTeller
    });

    for (let i = 0; i < players.length; i++) {
        session.characters.push({
            characterId: players[i].characters[0]._id,
            characterName: players[i].characters[0].name,
            experiencePoints: 3,
            storyTellerNote: lorem.generateParagraphs(1),
            playerNote: lorem.generateParagraphs(1)
        });
    }
    return await session.save();
}

async function createCoterie(chronicleId, userId) {
    let coterie = new Coterie({
        name: `${capitalize(lorem.generateWords(1))} ${capitalize(lorem.generateWords(1))}`,
        chronicleId: chronicleId,
        userId: userId,
        description: lorem.generateSentences(1),
        active: true,
    });
    await coterie.save();
    return coterie;
}

async function createPlayer(chronicleId) {
    let user = new User({
        googleId: uuid.v4(),
        email: `${lorem.generateWords(1)}${Math.floor(Math.random() * 100)}@gmail.com`,
        picture: randomImage(),
        displayName: `${capitalize(lorem.generateWords(1))} ${capitalize(lorem.generateWords(1))}`
    });
    await user.save();

    let player = new Player({
        userId: user._id,
        userDisplayName: user.displayName,
        chronicleId: chronicleId,
        userPicture: randomImage(),
        active: true
    });

    let character = await createCharacter(user._id);
    player.characters.push(character);
    await player.save();
    return player;
}

async function createCharacter(userId) {
    let character = new Character({
        userId: userId,
        name: `${capitalize(lorem.generateWords(1))} ${capitalize(lorem.generateWords(1))}`,
        alive: true,
        picture: randomImage(),
        startingExperience: 20,
        totalExperience: 100,
        mortal: {},
        mainInformation: {
            clan: clans[Math.floor(Math.random() * (clans.length))],
            generation: generations[Math.floor(Math.random() * (generations.length))],
            sire: `${capitalize(lorem.generateWords(1))} ${capitalize(lorem.generateWords(1))}`
        },
        health: {},
        willPower: {},
        attributes: {
            physical: Character.createCapacities(["strength", "dexterity", "stamina"]),
            social: Character.createCapacities(["carisma", "manipulation", "composure"]),
            mental: Character.createCapacities(["intelligence", "wits", "resolve"])
        },
        skills: {
            talents: Character.createCapacities(["athletics", "brawl", "Craft", "drive", "firearms", "larceny", "melee", "stealth", "survival"]),
            skills: Character.createCapacities(["animalKen", "etiquette", "insight", "intimidation", "leadership", "performance", "persuasion", "streetwise", "subterfuge"]),
            knowledges: Character.createCapacities(["academics", "awareness", "finance", "investigation", "medicine", "occult", "politics", "science", "technology"])
        },
        disciplines: [],
        advantages: [],
        flaws: [],
        backgrounds: []
    });

    await character.save();
    return character;
}

async function createStory(chronicle) {
    let story = new Story({
        name: capitalize(lorem.generateWords(3)),
        description: lorem.generateSentences(1),
        privateStory: lorem.generateParagraphs(1),
        publicStory: lorem.generateParagraphs(1),
        storyTeller: chronicle.storyTeller,
        chronicleId: chronicle._id,
        onGoing: false
    });
    await story.save();
    chronicle.stories.push(story);
    await chronicle.save();
    return story;
}

async function createChronicle(userId) {
    let chronicle = new Chronicle({
        name: capitalize(lorem.generateWords(3)),
        shortDescription: lorem.generateParagraphs(1),
        privateStory: lorem.generateParagraphs(1),
        publicStory: lorem.generateParagraphs(1),
        storyTeller: userId
    });
    return await chronicle.save();
}